from uuid import uuid4from django.db import modelsfrom catalogo.models.implementos_dep import Implementofrom reserva.models.reserva import Reservafrom catalogo.models.cancha import Canchaclass DetalleReserva(models.Model):    id = models.UUIDField(primary_key=True, default=uuid4, editable=False)    costo=models.FloatField(null=True,blank=True)    cancha = models.ForeignKey(Cancha,blank=True,null=True)    implementos = models.ForeignKey(Implemento,blank=True,null=True)    reserva = models.ForeignKey(Reserva,blank=True,null=True)    fecha_inicio=models.DateTimeField(blank=True,null=True)    fecha_fin = models.DateTimeField(blank=True,null=True)    created_at = models.DateTimeField(auto_now_add=True,null=True,blank=True)    updated_at = models.DateTimeField(auto_now=True,null=True,blank=True)    estado = models.BooleanField(default=True)    class Meta:        verbose_name = "DetalleReserva"        verbose_name_plural = "DetalleReservas"